import { useState } from "react";
import "../styles/BookLogin.css";

const BookLogin = () => {
  const [open, setOpen] = useState(false);

  return (
    <div className="scene">
      <div className={`book ${open ? "open" : ""}`}>

        {/* الغلاف */}
        <div className="cover">
          <h1>FocusMate</h1>
          <p>Smart Attention Monitoring System</p>

          <button onClick={() => setOpen(true)}>
            Get Started
          </button>
        </div>

        {/* صفحة اللوج إن */}
        <div className="page">
          <h2>Login</h2>

          <input type="email" placeholder="Email" />
          <input type="password" placeholder="Password" />

          <button>Login</button>
        </div>

      </div>
    </div>
  );
};

export default BookLogin;
